import React from "react";
import Banner from "../Banner/Banner";
import Categories from "./Categories";
import Grid from '@material'

const Home = () => {
  return (
    <>
      <Banner />
      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
      </Grid>
      <Categories />
    </>
  );
};

export default Home;
